// Slow
var longestIncreasingPath = function (matrix) {
  if (!matrix.length) return 0;

  const lastRow = matrix.length - 1;
  const lastCol = matrix[0].length - 1;
  const visited = new Array(lastRow + 1).fill(null)
    .map(() => new Array(lastCol + 1).fill(0));

  const tests = [[1, 0], [-1, 0], [0, 1], [0, -1]];

  const isSmallest = (row, col) => {

    for (let [rDiff, cDiff] of tests) {
      const rNext = row + rDiff;
      const cNext = col + cDiff;
      if (
        rNext < 0
        || rNext > lastRow
        || cNext < 0
        || cNext > lastCol
      ) continue;

      if (matrix[rNext][cNext] < matrix[row][col]) return false;
    }

    return true;
  }

  const queue = [];

  for (let r = 0; r < matrix.length; r += 1) {
    for (let c = 0; c < matrix[0].length; c += 1) {
      if (isSmallest(r, c)) {
        queue.push([r, c]);
        visited[r][c] = 1;
      }
    }
  }

  let longestPath = queue.length ? 1 : 0;

  while (queue.length) {
    const [row, col] = queue.shift();
    const currLength = visited[row][col];
    longestPath = Math.max(longestPath, currLength);

    for(let [rDiff, cDiff] of tests) {
      const rNext = row + rDiff;
      const cNext = col + cDiff;

      if(
        rNext < 0
        || rNext > lastRow
        || cNext < 0
        || cNext > lastCol
        || matrix[rNext][cNext] <= matrix[row][col]
        || visited[rNext][cNext] > currLength
      ) continue;

      visited[rNext][cNext] = currLength + 1;
      queue.push([rNext, cNext]);
    }

  }

  return longestPath;
}

// fast
var longestIncreasingPath = function (matrix) {
  if (!matrix.length) return 0;

  const lastRow = matrix.length - 1;
  const lastCol = matrix[0].length - 1;
  const visited = new Array(lastRow + 1).fill(null)
    .map(() => new Array(lastCol + 1).fill(0));

  const tests = [[1, 0], [-1, 0], [0, 1], [0, -1]];
  const getPathLength = (row, col) => {
    if (visited[row][col]) return visited[row][col];

    visited[row][col] = 1;

    let maxLength = 0;

    for (let [rDiff, cDiff] of tests) {
      const rNext = row + rDiff;
      const cNext = col + cDiff;

      if (
        rNext < 0
        || rNext > lastRow
        || cNext < 0
        || cNext > lastCol
        || matrix[rNext][cNext] <= matrix[row][col]
      ) continue;

      maxLength = Math.max(maxLength, getPathLength(rNext, cNext));
    }

    visited[row][col] += maxLength;

    return visited[row][col];
  }

  let longestPath = 0;

  for (let r = 0; r < matrix.length; r += 1) {
    for (let c = 0; c < matrix[0].length; c += 1) {
      longestPath = Math.max(longestPath, getPathLength(r, c));
    }
  }

  return longestPath;
}

